import React, { Component } from 'react';
import './App.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';

class App extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }

  render() {
    return (
            <Navbar>
              <Navbar.Header>
                  <NavbarBrand>
                    <a href="#home">DIY Drone</a>
                  </NavbarBrand>
              </Navbar.Header>
                    <Nav>
                        <NavItem eventKey={1} href="#">
                            견적
                        </NavItem>
                        <NavItem eventKey={2} href="#">
                            자유게시판
                        </NavItem>
                        <NavItem eventKey={3} href="#">
                            QnA게시판
                        </NavItem>
                    </Nav>
            </Navbar>
    );
  }
}

export default App;
